The initial evaluation of the newborn with PBS requires a team consisting of a <a href="https://www.healthychildren.org/English/family-life/health-management/pediatric-specialists/Pages/What-is-a-Neonatologist.aspx" target="_blank">neonatologist</a>, <a href="https://www.kidney.org/atoz/content/healthcareteam" target="_blank">nephrologist</a>, <a href="https://www.healthychildren.org/English/family-life/health-management/pediatric-specialists/Pages/What-is-a-Pediatric-Urologist.aspx" target="_blank">urologist</a> and in some cases other specialists (e.g., <a href="https://www.cardiosmart.org/Heart-Basics/What-is-a-Cardiologist" target="_blank">cardiologist</a>) as well.[831]&nbsp;Treatment options depend on&nbsp;the individual's age, health, medical history, extent of disease, tolerance for certain treatments or procedures, the expected course of the disease, and the parent's and/or guardian's opinions and preferences.<br />
<br />
In general, surgery may be done to repair&nbsp;abdominal muscle, genital, and bladder problems. Antibiotics may be given to infants to treat or prevent urinary tract infections.[833][11687][831] Timing of therapy may vary from patient to patient.&nbsp;
